import React from "react";
import Card from "@material-ui/core/Card";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faPlusCircle,
  faList,
  faPlay,
} from "@fortawesome/free-solid-svg-icons";

function Layout() {
  return (
    <div>
      <div className="cards-from-layout">
        <Card className="card-from-layout">
          <FontAwesomeIcon
            icon={faPlusCircle}
            size="3x"
            color="#2558c4"
            className="icons-from-layout"
          />
          <h1>Manage my Brands</h1>
        </Card>
        <Card className="card-from-layout">
          <FontAwesomeIcon
            icon={faPlay}
            size="3x"
            color="#2558c4"
            className="icons-from-layout"
          />
          <h1>Manage my Campaigns</h1>
        </Card>
        <Card className="card-from-layout">
          <FontAwesomeIcon
            icon={faList}
            size="3x"
            color="#2558c4"
            className="icons-from-layout"
          />
          <h1>Manage my budget</h1>
        </Card>
        <div className="copyright">
          <p>
            Copyright Â© 2019{" "}
            <a className="modatta-site" href="https://www.modatta.org/">
              Modatta.
            </a>{" "}
            All rights reserved.
          </p>
        </div>
      </div>
    </div>
  );
}
export default Layout;
